	<script language="JavaScript">
	 function KiemtraLe(a)
		{
			if((a%2==0) || (a>=3))
				{
					return 1;
				}
			else return 0;
			
		} 
//Bài 2 in ra tam giác vuông
	function  printTrigangle(n)
	{
		var str='';
		for(var i=0; i<n; i++)
			{
				for(var j=i; j<2*i+1;j++)
					{
						str += " * ";
					}
				str +='<BR>';
			}
		return str;
	}
	document.write("<b>Bài 1: In hình Tam giác vuông ngược với n =4</b>");
	document.write("<BR>");
	document.write(printTrigangle(5));
//Bài 3 in Hình vuông rỗng
	function  printEmptyRectangle(a, b)  // a là chiều rộng, b là chiều cao
	{
		var str='';
		for(var i=1; i<=b; i++)
			{
				if(i==1 || i==b){
					for(var j=1; j<=a;j++)
						{		
							document.write("*");
						}
					
				}
				else if(i>=2 && i<b)
				{
					for(var k=1; k<=a;k++)
						{
							if(k==1 || k==a)
								{
									document.write("*");
									
								}
							else{
								//document.write("<span style=\"color:white;\">" +" "+0+" "+"</span>");
								document.write("&nbsp;&nbsp;");
							}					
							
						}						
				}
				document.write("<BR>");
			}
		return ;
	}
	document.write("<BR>");
	document.write("<b>Bài 2: In hình vuông rỗng với chiều rộng và chiều cao bất kì</b>");	
	document.write("<BR>");
printEmptyRectangle(5, 5);
//Bài 4-------------------------------------------
	function printSpecialTrigangle(n)        //in tam giác cân ngược
		{
			for(var i=n;i >=1;i--)
				{
					if(i==n)
					{
						for(k=1;k<=2*n-1;k++)
							{
								{
									document.write("*");
								}
							}
					}
					else{
						for(var m=1; m<n-i+1; m++)    //for(var m=2*i-1; m<2*n-1; m++) => in ra tam giacs vuong nguoc
							{	
									document.write("&nbsp;&nbsp;");
							}		
						for(l=1;l<=2*i-1;l++)
							{
								document.write("*");
							}
					}

					document.write("<BR>");									
				}
			return;
		}
		document.write("<BR>");
		document.write("<b>Bài 3: In hình tam giác cân ngược với n nguyên bất kỳ</b>");
		document.write("<BR>");
		printSpecialTrigangle(9);
// Bài 4-------------------------------------------
	function printX(n)
	{
		var dem=0;
		for(var i=1;i<=n/2+1;i++)			//chạy in nửa trên của chữ x
			{
				for(var k=i;k<2*i-1;k++)	//vòng lặp có tác dụng in khoảng trắng bên trái của chữ X, khi i=1 thì ko in được khoảng trắng mà chỉ in được *
					{
						document.write(" &nbsp;&nbsp; ");
					}
					document.write(" * ");
				for(var j=i+1;j<n-i+1;j++)
					{
						dem++;
						document.write(" &nbsp;&nbsp; ");
					}
					if(dem>0){
							document.write(" * ");
						}
				document.write("<BR>");
				dem=0;
			}
		for(var k=n/2+2;k<n+1;k++)  // vòng lặp in tiếp nửa dưới của chữ X
			{
				for(var a=1;a<n-k+1;a++)
					{
						document.write(" &nbsp;&nbsp; ");
					}
				document.write(" * ");
				for(var b=1;b<2*k-n-2;b++)
					{
						document.write(" &nbsp;&nbsp; ");
					}
					document.write(" * ");
					document.write("<BR>");
			}			
			return;
	}
		document.write("<BR>");
		document.write("<b>Bài 4: In hình chữ X với n>=3 và n là số lẻ</b>");
		document.write("<BR>");
		document.write("<BR>");
		printX(5);
	//Bài 5:Viết function printButterfly(n), 
	//với n là số integer > 3 và là số lẻ, 
	//in ra hình con bướm có chiều cao bằng n
	function printButterfly(n)
	{
		var tam=0;
		for(var i=1;i<=n/2;i++)							// cho biến i chạy từ đầu đến 1/2 con bướm -1
			{
						for(var k=1;k<=i;k++)			// in giá trị ngôi sao phía bên trái
							{
							document.write(" * ");
							}
						for(var l = 1;l <= n-2*i; l++)
							{
							document.write(" &nbsp;&nbsp; "); // in tiếp theo các dấu cách vào các ngôi sao
							}
						for(var m=1;m<=i;m++)				// In tiếp theo các kí tự sao bên phải
							{
								document.write(" * ");
							}				
					
				document.write("<BR>");
			
			}
		for(var h=1;h<=n;h++)								// Vòng lặp in ra hàng giữa với số kí tự * = n
			{												// Sau khi in xong thì xuống dòng in tiếp nửa dưới 
				document.write(" * ");
			}
		document.write("<BR>");
		var dem=0;											// Biên đếm này dùng đê in ra khoảng trắng với điều kiện càng về cuối thì khoảng trắng càng tăng
		for(var j=Math.floor(n/2)+2;j<=n;j++)
			{
				for(var tam1=1;tam1<= n-j+1;tam1++)		//In hàng sau hàng giữa 1 hàng với 1 khoảng trắng
					{									
						document.write(" * ");
					}
				for(var tam2=1;tam2<=2*dem+1;tam2++)	//in nối tiếp kí tự trắng vào sau kí tự * vừa in và biến đếm thể hiện kí tự trắng tăng dần về cuối 
					{
						document.write(" &nbsp;&nbsp; ");
					}
					
				for(var tam3=1;tam3<=n-j+1;tam3++)	//In tiếp kí tự * vào khoảng trắng vừa in
					{								
						document.write(" * ");
					}
					dem++;							//Tăng biến đếm để in tiếp khoảng trắng
					document.write("<BR>");			//Xuống dòng để in tiếp dòng mới
			}
			return;
	}
	document.write("<BR>");
	document.write("<b>Bài 5: In hình Bướm với n>=3 và n phải là số lẻ</b>");
	document.write("<BR>");
	document.write("<BR>");
	printButterfly(33);

	</script>
